import React from 'react';

const Main = () => {
  return (
    <div id="main" className={styles.main}>
      {/* Postsコンポーネントをここに配置 */}
      <ul className="actions pagination">
        <li><a href="" className="disabled button large previous">前のページへ</a></li>
        <li><a href="#" className="button large next">次のページへ</a></li>
      </ul>
    </div>
  );
};

export default Main;
